event_description:
Dominica announced on April 1st closure of every non-essential establishment or business except the following: 
1) hardware stores and businesses that provide
products to the construction industry may open
between 6:00 a.m. to 2:00 p.m.
2) hotels, excluding any spas, gyms, discotheques and restaurants therein, other than for the provision of takeaway meals or room service;
3) commercial courier flights;
4) drive-thru or takeaway food vendors from 6:00a.m. to 2:00 p.m.;
5) businesses providing security guard services;
6) commercial ports and related businesses from 6:00 a.m. to 4:00 p.m. subject to any variation by the Dominica, Air and Sea Ports Authority (DASPA);
7) construction projects and manufacturing plants, subject to onsite compliance
8) motor omnibuses, hiring cars and taxis may operate between 6:00 a.m. to 5:00 p.m.

A liquor licence issued to a person under the Liquor Licences Act, Chapter 70:03, is hereby suspended from Wednesday the 1st day of April 2020 to Tuesday the 14th day of April 2020.

 All bars shall be closed throughout the period of this Order and there shall be no sale or consumption of alcohol in or in the vicinity of any shop, grocery store, or supermarket or in any public place 

The owner or operator of the business or establishment under (a) to (h) shall adhere to the physical distancing requirements at paragraph 8.
